      out.write("\t\t\t\t\t있어 준수하여야 하는 활용조건 및 절차, 활용자의 권리・의무 및 책임사항, 기타 필요한 사항을 규정함을 목적으로 합니다.</p>\r\n");
      out.write("\t\t\t\t<h4>제2조(용어의 정의) 이 약관에서 사용하는 용어의 뜻은 다음과 같습니다.</h4>\r\n");
      out.write("\t\t\t\t<ul>\r\n");
      out.write("\t\t\t\t\t<li>“공공정보”란, 「국가정보화기본법」 제3조 제1호에 따른 정보로서 「국가정보화기본법」제3조, 제10호에\r\n");
      out.write("\t\t\t\t\t\t따른 공공기관이 보유・관리하는 정보를 말합니다.</li>\r\n");
      out.write("\t\t\t\t\t<li>“제공기관”이란, 본 약관에 따라 정보를 제공하는 기관을 말합니다.</li>\r\n");
      out.write("\t\t\t\t\t<li>“통계정보”란, BBB에서 제공하는 콘텐츠 중 승인통계와 관련된 통계DB 및 통계DB 내용을 보여주는\r\n");
      out.write("\t\t\t\t\t\t통계표와 통계표 파일 및 온라인간행물에 대해서만 해당됩니다.</li>\r\n");
      out.write("\t\t\t\t</ul>\r\n");
      out.write("\t\t\t\t<h4>제3조(효력)</h4>\r\n");
      out.write("\t\t\t\t<ul>\r\n");
      out.write("\t\t\t\t\t<li>활용자가 본 약관을 읽고 동의하는 의사표시를 하는 경우 본 약관에 동의한 것으로 간주하며, 정보의 제공\r\n");
      out.write("\t\t\t\t\t\t및 활용에 관하여 본 약관의 적용을 받게 됩니다.</li>\r\n");
      out.write("\t\t\t\t\t<li>제공기관은 관련 법령 등을 위배하지 않는 범위에서 약관을 개정할 수 있습니다.</li>\r\n");
      out.write("\t\t\t\t\t<li>제2항에 따른 약관의 변경은 활용자가 동의함으로써 그 효력이 발생됩니다. 다만, 제2항에 따른 통지를\r\n");
      out.write("\t\t\t\t\t\t하면서 활용자에게 일정한 기간 내에 의사표시를 하지 않으면 의사표시가 표명된 것으로 본다는 뜻을 명확히 전달하였음에도\r\n");
      out.write("\t\t\t\t\t\t활용자가 명시적으로 거부의 의사표시를 하지 아니한 경우에는 활용자가 개정약관에 동의한 것으로 봅니다.</li>\r\n");
      out.write("\t\t\t\t\t<li>활용자는 정보 및 OpenAPI 연결, 다운로드, 웹 파싱 서비스를 활용할 시 주기적으로 제공기관의\r\n");
      out.write("\t\t\t\t\t\t공지사항을 확인하여야 하며, 제공기관에서 요구하는 사항에 대한 보고의 의무가 있습니다.</li>\r\n");
      out.write("\t\t\t\t\t<li>약관의 변경 사실 및 내역을 확인하지 못하여 발생한 모든 손해에 대한 책임은 활용자에게 귀속됩니다.</li>\r\n");
      out.write("\t\t\t\t</ul>\r\n");
      out.write("\t\t\t\t<h3>제 2 장 활용조건</h3>\r\n");
      out.write("\t\t\t\t<h4>제4조(권장사양)</h4>\r\n");
      out.write("\t\t\t\t<p>정보제공서비스 활용가능기기 및 활용에 필요한 최소한의 기술사양은 제공기관에서 제시하는 권장사양정보에 따르며,\r\n");
      out.write("\t\t\t\t\t활용자의 기술사양 등이 이에 미치지 못하는 경우 제공기관은 정보를 제공하지 않을 수 있습니다.</p>\r\n");
      out.write("\t\t\t\t<h4>제5조(금지사항)</h4>\r\n");
      out.write("\t\t\t\t<p style=\"margin-bottom: 5px;\">활용자는 다음 각 호의 행위를 하지 않아야 합니다.</p>\r\n");
      out.write("\t\t\t\t<ul>\r\n");
      out.write("\t\t\t\t\t<li>속임에 의한 활용자 사칭</li>\r\n");
      out.write("\t\t\t\t\t<li>전자적 접근 등으로 인한 바이러스・웜 등의 악성코드 등의 전파</li>\r\n");
      out.write("\t\t\t\t\t<li>저작권 위반 및 「정보통신망 이용촉진 및 정보보호 등에 관한 법률」 제44조 7의 불법정보 등과 결합\r\n");
      out.write("\t\t\t\t\t\t또는 연계 이용하는 행위</li>\r\n");
      out.write("\t\t\t\t\t<li>제공받은 정보를 특정한 서비스 플랫폼 없이 그대로 제3자에게 유료로 제공・공유하는 행위</li>\r\n");
      out.write("\t\t\t\t\t<li>활용자가 제공기관과 같은 공적 지위가 있는 것처럼 외관을 형성하거나, 본 약관의 동의가 없었음에도\r\n");
      out.write("\t\t\t\t\t\t불구하고 제공기관이 정보의 활용을 승인한 것으로 보이게 하는 방법으로 활용하는 행위</li>\r\n");
      out.write("\t\t\t\t\t<li>OpenAPI 연결방식의 위・변조 금지</li>\r\n");
      out.write("\t\t\t\t\t<li>OpenAPI 접속 인증키(key)의 무단 양도, 증여 및 담보 목적물로 사용하는 행위</li>\r\n");
      out.write("\t\t\t\t\t<li>접근이 허용된 범위 외에 권한 없이 접근을 시도하는 행위</li>\r\n");
      out.write("\t\t\t\t</ul>\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t<h4>제6조(활용제한)</h4>\r\n");
      out.write("\t\t\t\t<p style=\"margin-bottom: 5px;\">다음 각 호의 경우 제공기관은 정보의 일부 또는 전부를\r\n");
      out.write("\t\t\t\t\t제공하지 않을 수 있습니다.</p>\r\n");
      out.write("\t\t\t\t<ul>\r\n");
      out.write("\t\t\t\t\t<li>국제통계 등 라이선스 제약을 받는 경우</li>\r\n");
      out.write("\t\t\t\t\t<li>제공기관이 수용 가능한 트래픽을 초과하는 정보 활용의 경우</li>\r\n");
      out.write("\t\t\t\t\t<li>그 밖의 정상적인 업무수행에 현저한 지장을 초래하는 수준의 기술적 혹은 재정적 노력이 필요한 정보 활용의\r\n");
      out.write("\t\t\t\t\t\t경우</li>\r\n");
      out.write("\t\t\t\t\t<li>제공기관에서 기술적으로 제공하는 OpenAPI 서비스 외의 다른 형태의 OpenAPI 연결을 요청하는\r\n");
      out.write("\t\t\t\t\t\t경우</li>\r\n");
      out.write("\t\t\t\t</ul>\r\n");
      out.write("\t\t\t\t<h4>제7조(이용지침 준수 및 출처표시 의무)</h4>\r\n");
      out.write("\t\t\t\t<ul>\r\n");
      out.write("\t\t\t\t\t<li>활용자는 정보를 활용함에 있어 통계정보 이용지침을 준수하고 제공기관에서 제공된 정보임을 표시하는 출처표시\r\n");
      out.write("\t\t\t\t\t\t의무를 가집니다.</li>\r\n");
      out.write("\t\t\t\t\t<li>제공기관은 활용자가 제1항의 출처표시 의무 및 이용지침을 위반하는 경우 정보 제공을 중단하고 활용관계를\r\n");
      out.write("\t\t\t\t\t\t해지할 수 있습니다.</li>\r\n");
      out.write("\t\t\t\t</ul>\r\n");
      out.write("\t\t\t\t<h4>제8조(통계정보의 상업적 활용)</h4>\r\n");
      out.write("\t\t\t\t<ul>\r\n");
      out.write("\t\t\t\t\t<li>활용자는 통계정보를 상업적인 목적으로 활용할 수 있습니다. 다만, 예외사항으로 규정하는 경우에는 해당되지\r\n");
      out.write("\t\t\t\t\t\t않습니다.</li>\r\n");
      out.write("\t\t\t\t\t<li>예외사항은 변경될 수 있으며, 그 내역은 사이트를 통해 공지됩니다.</li>\r\n");
      out.write("\t\t\t\t</ul>\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t<h3>제3장 활용절차 및 방법</h3>\r\n");
      out.write("\r\n");
      out.write("\t\t\t\t<h4>제9조(제공방법)</h4>\r\n");
      out.write("\t\t\t\t<ul>\r\n");
      out.write("\t\t\t\t\t<li>제공기관은 제공기관에서 서비스하는 방식으로 정보를 제공할 수 있습니다.</li>\r\n");
      out.write("\t\t\t\t\t<li>제공기관은 계속적이고 안정적인 공공정보 서비스 제공을 위하여, 설비에 장애가 생기거나 관련 자료가 멸실된\r\n");
      out.write("\t\t\t\t\t\t경우에는 부득이한 사유가 없는 한 지체 없이 이를 수리 또는 복구하여야 합니다.</li>\r\n");
      out.write("\t\t\t\t\t<li>활용자는 데이터 플랫폼에 접근할 수 있도록 정한 프로토콜, 요청 및 출력 수단을 사용하여 자유롭게 본인이\r\n");
      out.write("\t\t\t\t\t\t만든 웹 서비스에 연동하거나 독립 프로그램을 개발하여 배포 할 수 있습니다.</li>\r\n");
      out.write("\t\t\t\t\t<li>활용자는 제공기관의 공공정보 서비스를 활용하여 영업활동을 하는 경우 그 영업활동의 결과에 대해 제공기관은\r\n");
      out.write("\t\t\t\t\t\t책임을 지지 않습니다. 또한 활용자는 이와 같은 영업활동으로 제공기관이 손해를 입은 경우 제공기관에 대해 손해배상의무를\r\n");
      out.write("\t\t\t\t\t\t지며, 제공기관은 활용자에 대해 서비스 활용제한 및 적법한 절차를 거쳐 손해배상 등을 청구할 수 있습니다.</li>\r\n");
      out.write("\t\t\t\t\t<li>정보의 제공 및 활용기간은 본 약관이 효력을 발휘하는 날로부터 1년으로 하며, 그 종료시점 30일 전에\r\n");
      out.write("\t\t\t\t\t\t제공기관이나 활용자의 특별한 의사표시가 없는 한 1년 더 갱신되는 것으로 합니다.</li>\r\n");
      out.write("\t\t\t\t\t<li>제공기관은 OpenAPI 연결의 방식으로 다음 각 호의 내용에 따라 정보를 제공할 수 있습니다.\r\n");
      out.write("\t\t\t\t\t\t<ol>\r\n");
      out.write("\t\t\t\t\t\t\t<li>OpenAPI 서비스의 이용은 제공기관의 업무상 또는 기술상 특별한 지장이 없는 한 연중무휴, 1일\r\n");
      out.write("\t\t\t\t\t\t\t\t24시간 운영을 원칙으로 합니다. 다만, 제12조제2항부터 제4항의 내용에 따라 일시 중단될 수 있습니다.</li>\r\n");
      out.write("\t\t\t\t\t\t\t<li>제공기관은 활용자에게 OpenAPI 서비스를 사용할 수 있는 인증키와 사용권을 부여하며, 활용자는\r\n");
      out.write("\t\t\t\t\t\t\t\t해당 인증키를 선량한 관리자의 주의 의무를 다하여 관리하여야 합니다.</li>\r\n");
      out.write("\t\t\t\t\t\t\t<li>제공기관은 OpenAPI 서비스를 특정 범위로 분할하여 각 범위 별로 이용가능시간을 별도로 지정할 수\r\n");
      out.write("\t\t\t\t\t\t\t\t있습니다. 다만, 이 경우 그 내용을 사전 공지하도록 합니다.</li>\r\n");
      out.write("\t\t\t\t\t\t</ol>\r\n");
      out.write("\t\t\t\t\t</li>\r\n");
      out.write("\t\t\t\t</ul>\r\n");
      out.write("\t\t\t\t<h4>제10조(비용)</h4>\r\n");
      out.write("\t\t\t\t<p style=\"margin-bottom: 5px;\">정보는 무상으로 제공하는 것을 원칙으로 합니다. 단,\r\n");
      out.write("\t\t\t\t\t제공기관에서 서비스하는 방법이 아닌 다른 방법으로 정보를 제공하여 줄 것을 요청한 경우에는 필요한 비용을 청구할 수\r\n");
      out.write("\t\t\t\t\t있으며, 비용을 산정하는 방법은 다음 각 호의 하나에 해당하는 경우에 따라 산정합니다.</p>\r\n");
      out.write("\t\t\t\t<ul>\r\n");
      out.write("\t\t\t\t\t<li>정보제공에 대한 제공기관의 산정 기준이 존재할 경우, 해당 기준에 따릅니다.</li>\r\n");
      out.write("\t\t\t\t\t<li>기타 제공기관과 활용자간의 별도 협의에 따릅니다.</li>\r\n");
      out.write("\t\t\t\t</ul>\r\n");
      out.write("\t\t\t\t<h4>제11조(활용변경 및 해지)</h4>\r\n");
      out.write("\t\t\t\t<ul>\r\n");
      out.write("\t\t\t\t\t<li>활용자는 정보의 활용수단 및 활용양 등의 변경사항이 있는 경우 제공기관에 활용변경을 요청할 수 있으며,\r\n");
      out.write("\t\t\t\t\t\t제공기관은 위법・부당한 활용변경이 아닌 경우 이에 응하여야 합니다.</li>\r\n");
      out.write("\t\t\t\t\t<li>활용자는 주소, 연락처, 전자우편 주소 등 활용계약사항이 변경된 경우에 해당 절차를 거쳐 이를 제공기관에\r\n");
      out.write("\t\t\t\t\t\t즉시 통보하여야 합니다. 활용자가 본 항의 개인정보 등을 적절히 변경하지 아니하여 발생하는 활용자의 손해 또는 손실 등\r\n");
      out.write("\t\t\t\t\t\t불이익에 대하여는 활용자가 책임을 부담합니다.</li>\r\n");
      out.write("\t\t\t\t\t<li>더 이상 정보의 활용이 필요 없는 활용자의 경우 해지의 의사표시로 본 약관에 의한 정보의 활용관계를\r\n");
      out.write("\t\t\t\t\t\t해지할 수 있습니다.</li>\r\n");
      out.write("\t\t\t\t\t<li>제공기관은 관련 법령 내용 및 활용자의 약관 및 준수사항 위반에 따라 활용관계를 해지할 수 있습니다.</li>\r\n");
      out.write("\t\t\t\t</ul>\r\n");
      out.write("\t\t\t\t<h4>제12조(제공중단)</h4>\r\n");
      out.write("\t\t\t\t<ul>\r\n");
      out.write("\t\t\t\t\t<li>제3조의 금지행위가 발생하는 등 활용자가 본 약관의 내용을 위반하는 경우 제공기관은 정보 제공을 중단할\r\n");
      out.write("\t\t\t\t\t\t수 있으며, 적법한 조치를 포함한 필요 조치를 취할 수 있습니다.</li>\r\n");
      out.write("\t\t\t\t\t<li>제공기관은 다음 각 호에 해당하는 경우 사전 공지 후 정보의 제공을 일시적으로 중단 할 수 있습니다.\r\n");
      out.write("\t\t\t\t\t\t<ol>\r\n");
      out.write("\t\t\t\t\t\t\t<li>시스템 정기점검, 증설 및 교체의 경우</li>\r\n");
      out.write("\t\t\t\t\t\t\t<li>서비스를 제공함에 있어 기술적 결함이 발견되는 경우</li>\r\n");
      out.write("\t\t\t\t\t\t\t<li>신규 서비스를 추가하는 경우</li>\r\n");
      out.write("\t\t\t\t\t\t\t<li>제공기관과 협의한 서비스 기준을 초과한 호출을 요청한 경우</li>\r\n");
      out.write("\t\t\t\t\t\t</ol>\r\n");
      out.write("\t\t\t\t\t</li>\r\n");
      out.write("\t\t\t\t\t<li>제2항에도 불구하고 제공기관은 긴급한 시스템 점검, 증설 및 교체 등 부득이한 사유로 인하여 예고 없이\r\n");
      out.write("\t\t\t\t\t\t일시적으로 OpenAPI 연결, 다운로드, 웹 파싱 서비스를 중단할 수 있으며, 새로운 OpenAPI 연결, 다운로드,\r\n");
      out.write("\t\t\t\t\t\t웹 파싱 서비스로의 교체 등 제공기관이 적절하다고 판단하는 사유에 의하여(예: 기능 개선 및 보안 등) 현재 제공되는\r\n");
      out.write("\t\t\t\t\t\t공공정보 서비스를 완전히 중단할 수 있습니다.</li>\r\n");
      out.write("\t\t\t\t\t<li>제공기관이 통제할 수 없는 사유로 인한 공공정보 서비스 중단의 경우(천재지변 등의 불가항력 상황,\r\n");
      out.write("\t\t\t\t\t\t시스템관리자의 고의・과실 없는 장애, 시스템다운 등)에 사전통지가 불가능하며, 타인(인터넷통신사업자 등)의 고의・과실로\r\n");
      out.write("\t\t\t\t\t\t인한 시스템중단 등의 경우에는 통지하지 못할 수 있습니다.</li>\r\n");
      out.write("\t\t\t\t</ul>\r\n");
      out.write("\t\t\t\t<h3>제4장 기타</h3>\r\n");
      out.write("\t\t\t\t<h4>제13조(면책)</h4>\r\n");
      out.write("\t\t\t\t<ul>\r\n");
      out.write("\t\t\t\t\t<li>제공기관은 활용자가 본 약관의 내용을 준수하지 않아 발생한 손해에 대하여 책임지지 않습니다.</li>\r\n");
      out.write("\t\t\t\t\t<li>정보는 현재 상태 그대로 활용할 수 있도록 제공되며, 제공기관은 정보에 포함된 오류, 누락 등 정보의\r\n");
      out.write("\t\t\t\t\t\t품질 또는 정보의 활용으로 인한 손해・손실에 대한 책임을 부담하지 않습니다.</li>\r\n");
      out.write("\t\t\t\t\t<li>제공기관은 관련 법령에서 정하는 사항 외에 정보와 관련된 진술, 보증, 의무, 책임을 부담하지 않습니다.</li>\r\n");
      out.write("\t\t\t\t\t<li>제공기관은 공공정보의 계속적 제공 또는 추가되는 공공정보의 지속적 제공을 보장하지 않습니다.</li>\r\n");
      out.write("\t\t\t\t\t<li>정보는 이용자에게 통보 없이 추가, 변경, 개선, 업데이트될 수 있습니다.</li>\r\n");
      out.write("\t\t\t\t\t<li>제공기관은 서비스 장애 등으로 발생한 활용자의 손해에 대해 책임을 지지 않습니다.</li>\r\n");
      out.write("\t\t\t\t\t<li>제공기관은 활용자와 제3자 상호 간에 서비스를 매개로 발생한 분쟁에 대해 개입할 의무가 없으며, 이로\r\n");
      out.write("\t\t\t\t\t\t인한 손해를 배상할 책임도 없습니다. 만일 활용자와 분쟁 중인 제3자가 제공기관을 상대로 이의를 제기할 경우 활용자는\r\n");
      out.write("\t\t\t\t\t\t제공기관을 자신의 비용과 책임으로 면책시켜야 합니다.</li>\r\n");
      out.write("\t\t\t\t</ul>\r\n");
