      out.write("\t\t\t\t\t</li>\r\n");
      out.write("\t\t\t\t\t<li>활용자가 제공한 모든 정보는 다음 각 호의 목적에 필요한 용도 이외로는 사용되지 않으며, 이용 목적이\r\n");
      out.write("\t\t\t\t\t\t변경될 시에는 사전 동의를 구하여야 합니다.\r\n");
